import { peliculas } from '../../../../../Data'

export default function ReadMovies(){
    let peliculas = peliculas
    return(
        <div>
            <h1>Read Movies</h1>
            {console.log(peliculas)}
            {peliculas.map((pelicula) => {
                return(
                    <div key={pelicula.idPelicula}>
                        <h2>{pelicula.nombre}</h2>
                        <p>{pelicula.genero}</p>
                        <p>{pelicula.duracion}</p>
                        <p>{pelicula.inventario}</p>
                    </div>
                )
            })}
        </div>
    )
}
